void test_DATA()
{
    init_filter();
    TEST_ASSERT_FLOAT_WITHIN(1e-5, XX0_hat[0], ekf.X[0]);
    TEST_ASSERT_FLOAT_WITHIN(1e-5, XX1_hat[0], ekf.X[1]);
    TEST_ASSERT_FLOAT_WITHIN(1e-5, XX2_hat[0], ekf.X[2]);
    TEST_ASSERT_FLOAT_WITHIN(1e-5, XX3_hat[0], ekf.X[3]);
    for (int i = 1; i < sizeof(XX0_hat)/sizeof(XX0_hat[0]); i++)
    {
        ekf.U[0] = UU0[i];
        ekf.U[1] = UU1[i];
        ekf.predict();
        if (!isnan(ZZ0[i]))
        {
            Z0[0] = ZZ0[i];
            ekf.update(Z0, R0);
        }
        if (!isnan(ZZ1[i]))
        {
            Z1[0] = ZZ1[i];
            ekf.update(Z1, R1, 1);
        }
        TEST_ASSERT_FLOAT_WITHIN(1e-5, XX0_hat[i], ekf.X[0]);
        TEST_ASSERT_FLOAT_WITHIN(1e-5, XX1_hat[i], ekf.X[1]);
        TEST_ASSERT_FLOAT_WITHIN(1e-5, XX2_hat[i], ekf.X[2]);
        TEST_ASSERT_FLOAT_WITHIN(1e-5, XX3_hat[i], ekf.X[3]);
    }
}


